import React from 'react';
import './App.css';
import Timer from './Timer'
import LabelCronometro from './LabelCronometro'
import {Navbar, Nav} from 'react-bootstrap';
import logo from './logo.png';



function App_timer() {
  return (
    <div>
		<Navbar bg="primary" variant="dark">
			<Navbar.Brand href="#home">Relógio Online</Navbar.Brand>
			<Nav className="mr-auto">
				<Nav.Link href="/cronometro">Cronômetro</Nav.Link>
				<Nav.Link href="/">Relógio</Nav.Link>
				<Nav.Link href="/timer">Timer</Nav.Link>
			</Nav>
		</Navbar>
<div class="menor inline"><img src={logo} className="App-logo" alt="logo" /></div>
    <div class="container">
    <div class="justify-content-center d-flex">
    <LabelCronometro class="display-3 titulo" name="Temporizador"/>
    </div>
    <div class="justify-content-center d-flex">
    <Timer/>
    </div>
    </div>
    </div>
  );
}

export default App_timer;
